window.bookSummaryJSON = "<p><b>Five thousand years ago, he tried to rule the civilized world. Now, he’s the only one who can save it.</b></p> <p>Once upon a time, Menkhef stood up to a powerful pharaoh, and lost. That’s a poor track record for someone acting as the lynchpin in an imminent supernatural war.</p> <p>Humanity is caught between an absent angel and a vengeful demon. The Council of Thirteen still lacks its final two members, and Menkhef - better known to his friends as Snag - is the only vampire whose mate has not returned. Holed up in an underground tomb complex beneath the oldest pyramid in Egypt, he and his comrades must watch as Bael’s forces gather in preparation for the final battle.</p> <p>Menkhef only has two secrets left. One will overturn the lives of an unsuspecting American couple. The other will change the entire landscape of the clash for humanity’s future.</p> <p><b>In the war between love and hate - death is not the end.</b></p> <p>The <i>Circle of Blood</i> series:<br> In another lifetime, six vampires lost their mates - and their mortality - to an unimaginable evil power. Now, if they can’t reunite with the reincarnated souls of their lost loves soon, it may just mean the end of the world. </p> <p>From <i>USA Today </i>best-selling author R. A. Steffan and fresh new voice Jaelynn Woolf comes a steamy paranormal romance series perfect for adult fans of vampire fiction. Download <i>Circle of Blood Book Six: Lovers' Victory</i> today, and discover the heart-stopping conclusion to a journey that explores the power of love in a world gone mad with hate.</p>"; 
